import React from 'react'
import "../pages/Signup.css";
import Grid from '@mui/material/Grid';
import Box from '@mui/material/Box';
import TextField from '@mui/material/TextField';
import { Button } from '@mui/material';

export default function Signup() {
    return (
        <>
            <Grid container>
                <Grid item lg={8} className="bg">
                    .
                </Grid>
                <Grid item lg={4}>
                    <form className="form">
                        <TextField className="mb-4" label="Email" type="email" variant="standard" fullWidth={true} />
                        <TextField className="my-4" label="Password" type="password" variant="standard" fullWidth={true} />
                        <Button className="mt-4" type="submit" variant="contained">submit</Button>
                    </form>
                </Grid>
            </Grid>
        </>
    )
}
